const Internships = () => {
  return (
    <div>
      <h2>Available Internships</h2>
      <ul>
        <li>Frontend Developer Intern</li>
        <li>Backend Developer Intern</li>
        <li>UI/UX Designer Intern</li>
      </ul>
    </div>
  );
};

export default Internships;
